  [],\n\t\"revision_timestamp\": \"2016-10-03T23:16:33.580893\",\n\t\"name\": \"noaa-office-for-coastal-management-coastal-inundation-digital-elevation-model-philadelphia-penn\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data were created as part of the
  National Oceanic and Atmospheric Administration Coastal Services Center's efforts
  to create an online mapping viewer called the Sea Level Rise and Coastal Flooding
  Impacts Viewer. It depicts potential sea level rise and its associated impacts on
  the nation's coastal areas. The purpose of the mapping viewer is to provide coastal
  managers and scientists with a preliminary look at sea level rise (slr) and coastal
  flooding impacts. The viewer is a screening-level tool that uses nationally consistent
  data sets and analyses. Data and maps provided can be used at several scales to
  help gauge trends and prioritize actions for different scenarios. The Sea Level
  Rise and Coastal Flooding Impacts Viewer may be accessed at: https://coast.noaa.gov/slr
  This digital elevation model (DEM) is a part of a series of DEMs produced for the
  National Oceanic and Atmospheric Administration Coastal Services Center's Sea Level
  Rise and Coastal Flooding Impacts Viewer described above. The DEM created for this
  project was developed using the NOAA National Weather Service's Weather Forecast
  Office (WFO) boundaries. This DEM includes the best available lidar data known to
  exist at the time of DEM creation that met project specifications, for the eastern
  shore of Maryland. This DEM falls in a portion of the Philadelphia, Pennsylvania
  (PHI) WFO and also in a portion of the Wakefield, Virginia (AKQ) WFO. The DEM covers
  the following Maryland counties: Cecil (portion) and Kent. This DEM is derived from
  multiple lidar datasets furnished by NOAA, the United States Army Corps of Engineers
  (USACE), and the United States Geological Survey (USGS). A list of lidar data sources
  can be found in the Process Lineage. Hydrographic breaklines were delineated using
  lidar intensity imagery generated from the lidar. The DEM is hydro flattened such
  that water elevations are less than or equal to 0 meters. The DEM is referenced
  vertically to the North American Vertical Datum of 1988 (NAVD88) with vertical units
  of meters and horizontally to the North American Datum of 1983 (NAD83). The resolution
  of the DEM is approximately 10 meters.\",\n\t\"license_title\": null,\n\t\"extras\":
